 true, //We're registering the JwtModule as global to make things easier for us.\n      //This means that we don't need to import the JwtModule anywhere else in our application.\n      secret: jwtSecret.secret,\n      signOptions: { expiresIn: '5m' }, // e.g. 30s, 7d, 24h\n    }),\n    LoginModule,\n  ],\n  controllers: [AuthController],\n  providers: [AuthService, JwtStrategy],\n  exports: [MongooseModule],\n})\nexport class AuthModule {}\n// If the vast majority of your endpoints should be protected by default, you can register the\n// authentication guard as a and instead of using @UseGuards() decorator on top of each\n// controller, you could simply flag which routes should be public.\n// providers: [\n//   {\n//     provide: APP_GUARD,\n//     useClass: JwtStrategy,\n//   },\n//   AuthService,\n// ],\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/AuthService.html":{"url":"injectables/AuthService.html","title":"injectable - AuthService","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Injectables\n  AuthService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/auth/auth.service.ts\n        \n\n\n\n\n\n            \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                    Async\n                                signIn\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n            \n    Constructor\n        \n            \n                \n                    \nconstructor(loginService: LoginService, jwt_Service: JwtService)\n     